        <Route path='/project-the-chow' component={''}/>
        <Route path='/travelopia' component={''}/>
        <Route path='/lambda-school' component={''}/>
        </ScrollToTop>
    </Switch>
    </div>
  );
}

export default App;

const Nav = styled.nav`

